import React from "react";
import { Link } from "react-router-dom";

export default function Home(){
    return(
        <>
            <h1>Home</h1>
            <Link to={'/FindJob'}>Find a Job</Link>
            <Link to={'/SubmitOffer'}>Find a Job</Link>
        </>
    )
}
